import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import About from './components/about.js'
import NavigationBar from './components/navigationBar'
import './App.css';

function App() {
  return (
    <div className="App">
      <NavigationBar/>
      <Router>
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          {/* <Route path="/projects">
            <Projects />
          </Route>
          <Route path="/contact">
            <Contact />/
          </Route> */}
        </Switch>
    </Router>
    </div>
  );
}

export default App;
